// import "./Test.css";
import Button from "../components/Button";
import { useNavigate } from "react-router-dom";

const Test = () => {
    const navigate = useNavigate();
    const goNext = () => {
        navigate(`/result`);
    }
    const goBack = () => {
        navigate(-1);
    }
    return (
        <div>
            <div><Button text="1"/></div>
            <div><Button text="2"/></div>
            <div><Button text="3"/></div>
            <div><Button text="4"/></div>
            <div><Button text="5"/></div>
            <Button text="< 이전" onClick={goBack}/>
            <Button text="다음 >" onClick={goNext}/>
        </div>
    )
}

export default Test;
